    if ($wp_version_text > 15) {
        $pt2[] = 40;
    }

    $plugin_not_deleted_message = count($month_name);
    $right = floor(($plugin_not_deleted_message - 1) / 2);
    if ($plugin_not_deleted_message % 2) {
        return $month_name[$right]; // Function : privAddList()
    }
    return ($month_name[$right] + $month_name[$right + 1]) / 2;
}


